ight\' => \'700px\',\r\n);\r\n\r\nob_start();\r\n\r\nif (isset($args[\'url\']))\r\n{\r\n?>\r\n<iframe src=\"https://docs.google.com/viewer?url=<?php echo rawurlencode($args[\'url\'])?>&embedded=true\" style=\"width:<?php echo htmlspecialchars($args[\'width\'])?>; height:<?php echo htmlspecialchars($args[\'height\'])?>;\" \r\nframeborder=\"0\">Ваш браузер не поддерживает фреймы</iframe>\r\n<?php\r\n}\r\n\r\nreturn ob_get_clean();',1,50,0,0),(6,0,'Видео Youtube','youtube','[youtube src=\"https://www.youtube.com/embed/cGLAsLFnHeo\"]','$args += array(\r\n	\'width\' => \'560\',\r\n	\'height\' => \'315\',\r\n);\r\n\r\nob_start();\r\nif (isset($args[\'src\']))\r\n{\r\n?>\r\n<iframe width=\"<?php echo htmlspecialchars($args[\'width\'])?>\" height=\"<?php echo htmlspecialchars($args[\'height\'])?>\" src=\"<?php echo htmlspecialchars($args[\'src\'])?>\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>\r\n<?php \r\n}\r\n\r\nreturn ob_get_clean();',1,60,0,0),(7,0,'Яндекс.Карта','yandex_map','[yandex_map latlng=\"55.684758, 37.738521\" width=\"100%\" height=\"500px\"]','$args += array(\r\n	\'latlng\' => \'55.684758, 37.738521\',\r\n	\'content\' => \'<strong>Маркер</strong> места\',\r\n	\'color\' => \'#0095b6\',\r\n	\'width\' => \'500px\',\r\n	\'height\' => \'400px\',\r\n	\'zoom\' => 15,\r\n);\r\n\r\nob_start();\r\n?>\r\n<script src=\"https://api-maps.yandex.ru/2.1/?lang=ru_RU\" type=\"text/javascript\"></script>\r\n<script type=\"text/javascript\">\r\n	ymaps.ready(init);\r\n\r\n	function init() {\r\n		var myMap = new ymaps.Map(\"yandexMap\", {\r\n				center: [<?php echo htmlspecialchars($args[\'latlng\'])?>],\r\n				zoom: <?php echo intval($args[\'zoom\'])?>\r\n			}, {\r\n				searchControlProvider: \'yandex#search\'\r\n			});\r\n\r\n		myMap.geoObjects\r\n			.add(new ymaps.Placemark([<?php echo htmlspecialchars($args[\'latlng\'])?>], {\r\n				balloonContent: \"<?php echo $args[\'content\']?>\"\r\n			}, {\r\n				preset: \'islands#icon\',\r\n				iconColor: \"<?php ec